      display: inline-block;
      margin: 20px 0;
    }
    .button {
      background: #ff9900;
      color: white;
      padding: 15px 25px;
      border-radius: 8px;
      text-decoration: none;
      font-weight: bold;
      transition: background 0.3s;
    }
    .button:hover {
      background: #cc7a00;
    }
    footer {
      margin-top: 50px;
      font-size: 0.9em;
      opacity: 0.7;
    }

    /* Animation keyframes */
    @keyframes float {
      0% { transform: translatey(0px); }
      50% { transform: translatey(-10px); }
      100% { transform: translatey(0px); }
    }
    @keyframes fadeIn {
      from { opacity: 0; }
      to { opacity: 1; }
    }
    @keyframes launch {
      0% { bottom: -150px; opacity: 0; }
      50% { opacity: 1; }
      100% { bottom: 100%; opacity: 0; }
    }
